import React, { Component } from 'react';

class ControlPanel extends Component {
  render() {
    return (
      <div>
        <h1> Control Panel </h1>
        <button onClick={this.props.ctx.resume()}> Pause/Play </button>
      </div>
    );
  }
}

export default ControlPanel;
